import React, { useState, useEffect } from 'react';
// import { Navigate } from 'react-router';
import { Card, Button, Image, Container, Row, Col } from 'react-bootstrap';
import axios from 'axios';

const Gallery = (props) => {

    const [images, setImages] = useState([]);

    useEffect(() => {
        let email = localStorage.getItem('email');
        let token = localStorage.getItem('token');

        const headers = {
            'Content-Type': 'application/json',
            'Authorization': 'Bearer ' + token
        }

        axios.get("http://localhost:8060/image/fetch/" + email, {
            headers: headers
        }).then(response => {
            console.log(response.data);
            setImages(response.data.payload);
        }).catch(error => console.log(error.message));
    }, []);

    // if (!props.loggedIn) {
    //     return <Navigate to="/login" />
    // }

    return (
        <div>
            <Container>
                <Row>
                    {images.map(image => (
                        <Col lg={4} md={6} sm={12}>
                            <Card style={{marginBottom: '20px', maxWidth: '500px'}}>
                                <Card.Img className="mx-auto" style={{ width: '90%', height: '250px', objectFit: 'contain' }} variant="top"
                                    src={"http://localhost:8060/image/18/display/" + image.url} />
                                <Card.Body>
                                    <Card.Title>{image.metadata.originalFileName}</Card.Title>
                                    <Card.Text>
                                        Some quick example text to build on the card title and make up the bulk of
                                        the card's content.
                                    </Card.Text>
                                    <Button variant="primary">Go somewhere</Button>
                                </Card.Body>
                            </Card>
                        </Col>
                    ))}
                </Row>
            </Container>
        </div>
    )
}

export default Gallery
